column8:
半世紀近い社歴で培われたメーカーとのネットワークにより<br>
日本全国どの場所でも、万全のアフターサービス体制を完備しており、<br>
安心してお買い求めいただけます。<br><br>

●あらゆる負荷に対応します。商用電源並みの安定した電源を供給します。<br>
●インバーター負荷・サイリスタ負荷・コンピュータ制御の負荷などにも対応しています。<br>
●瞬時電圧降下を抑える設計により、モーターなどの始動が抜群です。<br>
●最新のクリーンエンジンを搭載した第3次排出ガス対策建設機械です。<br><br>


<style type="text/css">
p.test1{line-height:110%;}
</style>


<table width="650" cellspacing="1" cellpadding="4">
  <tr>
    <td colspan="2">
      <img src="http://image.rakuten.co.jp/auc-mikawa-kiko/cabinet/03086639/img62736080.jpg" width="440" height="140" />
    </td>
  </tr>
  <tr>
