  </tr>
  <tr>
    <td width="360" valign="top">
      <img src="http://image.rakuten.co.jp/auc-mikawa-kiko/cabinet/03086639/img62741753.jpg" width="300" height="75" /><br>
      <p class="test1">
      <small>電子式で速度制御をおこなう電子ガバナを装備することにより、負荷の大きさにかかわらず、エンジン回転数を一定に制御します。（アイソクロナス制御<font size="1"><sup>※1</sup></font>）また、用途に応じて制御箱内のスイッチで速度調整するドループ制御に切替できます。<font size="1"><sup>※2</sup></font><br>
      ※1 DCA-20LSK、25LSK、45LSKはアイソクロナス制御のみです。<br>
      ※2 DCA-60～400LSKは工場出荷時ドループ制御となります。
      </small>
      </p>
    </td>
    <td valign="top">
    <img src="http://image.rakuten.co.jp/auc-mikawa-kiko/cabinet/03086639/img62755081.jpg" width="350" height="220" />
    <br>
    <p class="test1">
    <small>三相出力の電圧（200
    V級⇔400V級）をボンネット内の切替スイッチでワンタッチで切替えることができます。また、操作パネルでも表示灯にて出力モードを確認することもできます。</small>
    </p>
    </td>
  </tr>
  <tr>
    <td>&nbsp;</td>
    <td>&nbsp;</td>
  </tr>
</table>
