■３８πのケーブル・ジョイント付（+２０ｍ　-１０ｍ）です！！<br><br>
【クラス最小のスリムボディ 566mm】<br><br>

【クラス最軽量の軽量ボディ 338kg(乾燥質量）】<br><br>

【溶接使用率 作業効率アップ100％】<br><br>

●独自の多極ロータの採用により、<br>
、発熱しにくく損失の少ない高効率発電体を実現しました。<br>
さらにエンジンへの負荷も大幅に軽減されました。<br><br>

●無負荷電圧が常に高いレベルで維持できる独自の制御方式により、<br>
アーク特性にすぐれた高品質溶接を実現しました。<br><br>

●手ブレによる電流の変動幅が低減し、ビードがきれいです。<br><br>

●騒音低減・燃料節約および排気ガスを低減するエコ溶接機能を装備しています。<br>
スローダウン回転数で4.0mmまでの溶接が可能です。<br>k

●交流電源は三相4線200V（9.9kVA）、<br>
単相100V（コンセント2ヶ、単相専用出力端子、6.0kVA）が使用できます。<br><br>

●交流電源には感電防止のためブレーカに漏電遮断機を装備しています。<br><br>

●溶接作業や交流電源を使用していない時にエンジンを自動的に低速回転にする<br>
スローダウン装置を装備しています。<br><br>

●冷却水温、エンジン油圧、充電の異常時にはエンジンを非常停止させます。<br>
また、表示灯には信頼性のあるLEDを採用しました。<br><br>

●日常点検やメンテナンスが容易に行える3面ドアを採用しました。<br><br>






